import React, { Component } from 'react'


class Item extends Component {

constructor(){
    this.state = {
        selected: false
    }

}

onClick = () => {
    this.setState({selected: !this.state.selected})
}

render () {
    return (
        <li onClick={this.onClick} class={this.state.selected ? "selected" : "unselected"}>
            <img src="https://place-hold.it/256x256" />
        </li>
    )
}

}

export default Item
